import React from 'react';

function ProductDetail({ product, onEdit }) {
  if (!product) {
    return <div>No product found for this Trace ID.</div>;
  }

  return (
    <div>
      <h2>Product Details</h2>
      <p><strong>Trace ID:</strong> {product.id}</p>
      <p><strong>Growing Locations:</strong> {product.farmName}</p>
      <p><strong>Organic Certified:</strong> {product.organicCertified}</p>
      <p><strong>Planted Date:</strong> {product.dateSow}</p>
      <p><strong>Seed Variety:</strong> {product.seedVariety}</p>
      <p><strong>Grown for:</strong> {product.grownFor}</p>
      <p><strong>Harvested Date:</strong> {product.dateHarvested}</p>
      <p><strong>THC compliance level:</strong> {product.thc}</p>
      <p><strong>Current Status:</strong> {product.currentStatus}</p>
      <button onClick={onEdit} style={{ marginTop: 16 }}>Edit Product</button>
    </div>
  );
}

export default ProductDetail;
